INSERT INTO `guest` VALUES ('1', '第一期', '真人阅读-沟通与分享', null, 'pic/pic01.jpg', '“每个人都是一本书。”2012年12月16日，医学分馆邀请学生会推荐的四六级通关达人余嘉欣和李开元作为真人书，在创意活动室举办了第一次活动“真人阅读”。20位同学提问踊跃，交流主要围绕四六级答题技巧和备考经验展开。这种方式打破了讲座培训的旧模式，让沟通与分享成为新型学习的主旋律。', '0', '2019-01-08 00:00:00', '2019-01-08 00:00:00', '0', '30');
INSERT INTO `guest` VALUES ('92', '第二期', '灵魂的牧场', null, 'pic/pic02.jpg', '秋去春来，晚樱谢尽，桐絮纷飞，又开始了新的轮回。我们也许只能陪伴珞珈四个四季，而老师们，却与武大共度了流金岁月数十载。青色琉璃瓦印下了他们的风姿 ，鹅卵石铺就的石板地刻下了他们的足迹，成排端坐的学生们，连同樱顶的月亮，与珞珈的草木一起，写入了难忘的回忆，由他们谱成了一支支动人的乐曲。', '0', '2019-01-12 12:10:00', '2019-01-12 16:10:05', '0', '30');
INSERT INTO `guest` VALUES ('93', '第三期', '自然辩证法', null, 'pic/pic03.jpg', '绽放虽然绚烂之极，但从含苞待放到凋谢不过一周时间，且开且落，故有“樱花七日“之说。所以文学作品中常常感叹这一期一会——何瑞\r\n预告', '0', '2019-01-10 14:09:44', '2019-01-10 15:09:51', '0', '30');
INSERT INTO `guest` VALUES ('94', '第四期', '让阅读更文艺', null, 'pic/pic04.jpg', '\"“为文用心，雕缛成龙”，让我们趁着春光，与李建中老师一起讨论《文心雕龙》，在贯穿古今、纵横文理的思想碰撞中寻找美、发现美，在诗意的生活中，找到属于自己的文心； 绽花映照诸天万物，凝露折射形相本理，让我们借着月色，与高文强老师一起探讨佛教文化，明心见性，觅理求玄，勾勒那缕佛台灵光。 让我们趁着大好年华，与两位老师一起探寻通识教育，在改革的探索与实践中找回大学的理想，践行珞珈的精神。\"', '0', '2019-01-09 12:09:27', '2019-01-14 14:09:33', '0', '30');
INSERT INTO `guest` VALUES ('96', '第六期', '认识一种植物', null, 'pic/pic06.jpg', '**大学生命科学院植物发育生物学博士讲述各种植物的前世今生热心公益的科普志愿者沙湖公园的特邀管理者致力打造人与自然的和谐世界', '0', '2019-01-07 08:09:02', '2019-01-07 20:09:10', '0', '30');
INSERT INTO `guest` VALUES ('97', '第七期', '图书馆之夜', null, 'pic/pic07.jpg', '6月3日的午后，天朗气清，惠风和畅。透过图书馆的玻璃墙能够看到汤湖无垠的水波。微天堂真人图书馆与公共图书馆的合作计划，从最美图书馆-汤图开启……', '0', '2019-01-06 10:08:43', '2019-01-06 12:08:52', '0', '30');
INSERT INTO `guest` VALUES ('98', '第八期', '天才是怎样炼成的', null, 'pic/pic08.jpg', '从小的按部就班让我们早已忘了如何做自己生活其实有很多方式，精彩也不仅仅只有一种 李红豪，书写了两个大字——勇敢', '0', '2019-01-05 14:08:27', '2019-01-05 16:08:34', '0', '30');
INSERT INTO `guest` VALUES ('99', '第九期', '把骨缝里的痛苦灸出来', null, 'pic/pic09.jpg', '当你走上了一条不喜欢的路，不要妄图退回去重选，但一定要努力积累，为下一次选择做好准备。 ——王红恩 在贝加尔湖畔首先会想到苏武牧羊，一个古代英雄曾经到达的地方 ——桂祎明 地球一共有50亿年的生命，46年亿年已经过去了，还有4亿年地球就会消失，所以没有什么可怕的，想做什么就去做什么吧 —李红豪', '1', '2019-01-04 13:08:09', '2019-01-04 15:08:19', '0', '30');
INSERT INTO `guest` VALUES ('100', '第十期', '音乐之路', null, 'pic/pic10.jpg', '作为一个对音乐无比热爱的妹子，她四岁起习琴，学了八年。电子琴拿了很多奖。一直想考音乐学院，但一直没有机会。会钢琴，吉他，喜欢作曲，梦想上中国好歌曲。有几首自己的原创作品。登上了好歌曲的校园推介会的活动。一直纠结于是否走音乐这条职业道路。她着重提到自己对音乐的理解，她认为音乐是一种思想，升华灵魂。我们在不同的音乐下体验不同的情感经历。听什么样的音乐，对我们形成什么样的性格，甚至做出什么样的行为，都有很大的关系。', '0', '2019-01-01 00:00:00', '2019-01-01 00:00:00', '0', '30');
INSERT INTO `guest` VALUES ('101', '第十一期', '我的大学那点事', null, 'pic/pic11.jpg', '你是否想知道那年的纸飞机飞向何方？ 你是否想知道他心中她的模样？恋曲1990，今天再次吟唱。', '0', '2019-01-03 00:00:00', '2019-01-03 00:00:00', '1', '30');
