INSERT INTO `guest` VALUES ('105', '第十五期', '两万公里的零距离', null, 'pic/pic1370437631159402321.jpg', '他们来自不同的国度，\n因为对中国文化的喜爱，\n相聚在一起。\n两万公里，四海一珈，\n心与心之间，零的距离。', '0', '2019-05-14 09:00:00', '2019-05-14 11:00:00', '2', '100');
INSERT INTO `guest` VALUES ('106', '第十六期', '生来摇滚', null, 'pic/pic1981861829894558838.jpg', '美国50年代的音乐先锋，\n中国80年代的符号记忆，\n摇滚，\n这个承载着许多人不羁想象的词，\n离我们的生活真的有那么远吗？', '0', '2019-05-31 14:00:00', '2019-05-31 16:00:00', '4', '120');
