INSERT INTO `pastreview` VALUES ('103', '2019-05-03 11:42:41', null, '<p><img src=\"http://120.78.176.185:8056/rev/rev8455187628659128524.jpg\" style=\"max-width:100%;\"><br></p><p>河南省三门峡市原市委书记赵海燕，被坊间称为“卖官书记”。近日，其身影出现在一份由中国裁判文书网公布的判决书中，该判决书系灵宝市（三门峡市下辖县级市）原市委书记李宏伟行贿、受贿案。<br><br>文书披露“卖官书记”赵海燕受贿细节：下属送百万现金获提拔<br>河南省延津县法院一审查明，李宏伟索贿、受贿财物共计8849907.33元，并为谋取职务上的提拔，先后9次送赵海燕（另案处理）现金共计100万元。2016年3、4月份，赵海燕推荐李宏伟担任灵宝市市委书记。<br><br>公开资料显示，2016年6月27日，李宏伟出任灵宝市委书记，而半月后的2016年7月16日，时任三门峡市委书记的赵海燕涉嫌严重违纪，接受组织调查。<br><br>2017年8月31日，河南省纪委宣布，李宏伟接受组织审查。2018年4月14日，延津县法院一审判决李宏伟犯受贿罪、行贿罪，合并执行有期徒刑十三年，并处罚金三百万元。<br><br>索贿、受贿八百多万元<br><br>曾任河南省陕县副县长、三门峡市开发区管委会副主任、灵宝市委书记的李宏伟，因涉嫌受贿罪，于2017年10月1日由河南省延津县检察院决定监视居住,当年11月24日，其被延津县公安局执行逮捕。<br><br>2017年12月15日，延津县检察院以李宏伟犯受贿罪、行贿罪，向延津县法院提起公诉。<br><br>法院审理查明，从2008年至2017年8月份，被告人李宏伟担任陕县副县长、三门峡市开发区管委会副主任、灵宝市委书记期间，利用职务上的便利，为三门峡某化纤有限公司、陕县某煤矿等单位和个人谋取利益，先后收受、索要上述单位及个人财物共计8849907.33元。<br><br>澎湃新闻梳理李宏伟案判决书发现，其最主要的“金主”为河南某房地产开发公司实际控制人郑某，李宏伟先后索要、收受郑某财物286万余元。其中包括一辆丰田霸道越野车，而此事还与三门峡市原市委书记杨树平有关，杨树平于2015年7月落马。<br><br>延津县法院审理查明，2014年9月，郑某出资515293.33元在北京给被告人李宏伟的女儿李某购买丰田霸道车一辆，至案发前该车由李某使用。<br><br>郑某证言证实，2014年8、9月份的一天，李宏伟让他给李某弄一辆20多万元北京牌照的车，并说杨树平（时任三门峡市委书记）女儿的车出车祸了，李某的车给杨树平的女儿用了。后来，郑某通过同学在北京买了一辆白色的丰田霸道越野车，并租赁了一个车牌，交给李某使用。<br><br>用贿款投资“获利”一千多万元<br><br>法院还审理查明，李宏伟通过收受贿款，用于购买房屋或投资，至案发已产生孳息及利息1100多万元。<br><br>其中，2009年，时任陕县副县长的李宏伟收受一矿老板200万元，用于在北京购房。因房价上涨，案发后经评估，该笔贿款产生孳息7000885.12元。<br><br>2012年6月份，被告人李宏伟以其妻子杨某投资吃高息为名向刘某“借”200万元，在李宏伟家有偿还能力的情况下，至今一直未予归还。在刘某多次向其提出归还的要求之下，李宏伟分别于2012年10月份左右、2015年1月份抵给刘某一辆价值40万元的丰田霸道轿车和价值60万元的房产一套。<br><br>杨某用“借”来的200万元和其另外筹措的700万元一起先后放在河南某置业有限公司、某钢材有限公司、某实业公司等单位获取利息。至案发李宏伟收受的这200万元贿款共违法获利4013479.424元。<br><br>判决书显示，辩护人辩称被告人李宏伟与刘某间的200万元往来应该是借贷关系而非受贿。<br><br>法院审理后认为，被告人李宏伟与刘某平时无经济往来，刘某之前并不愿意“借”给李宏伟200万元，但是考虑到李宏伟的领导身份，以及之前李宏伟为其实际控股的煤矿提供过帮助才同意的，但是李宏伟具有归还的能力，一直未归还。在刘某多次向李宏伟要钱的情况下只是用一套房和一辆车抵了100万元。<br><br>法院认为，认定是否受贿不能仅仅看是否有书面的借款手续，根据《全国法院审理经济犯罪案件工作座谈会议纪要》第六部分的规定“国家工作人员利用职务上的便利，以借为名向他人索取财物，或者非法收受财物为他人谋取利益的，应当认定为受贿。”所以辩护人的辩护意见不成立，不予采纳。<br><br>行贿市委书记100万元获提拔<br><br>除了受贿，法院一审查明李宏伟还犯有行贿罪。<br><br>判决书显示，2012年至2016年春节期间，被告人李宏伟为谋取职务上的提拔，先后9次到时任三门峡市市长、市委书记赵海燕（另案处理）的办公室送给其现金共计100万元。<br><br>被告人李宏伟称，2012年时，他是三门峡市民政局副局长，考虑到赵海燕是新任领导，为了加深赵海燕对他的印象，就趁着中秋节、春节以拜年为名到赵海燕办公室先后九次共送给赵某3100万元钱。<br><br>李宏伟称，他之所以送给赵海燕送100万元主要是因为赵海燕在三门峡市先后担任市长、市委书记，他为了在工作上及个人职务升迁上能够取得她的支持，才给她送的这100万元钱。<br><br>赵海燕证言证实，其在任三门峡市市长、市委书记期间，李宏伟先后分九次在其办公室给她送去了100万元现金，她在李宏伟个人的职务升迁上给李宏伟提供了帮助。<br><br>此外，相关证人证实，李宏伟在主持三门峡市开发区工作之前，赵海燕向其推荐李宏伟主持工作；2016年3、4月份，赵海燕推荐李宏伟担任灵宝市市委书记。<br><br>公开资料显示，2016年6月27日，李宏伟出任灵宝市委书记。此后不足一月，2016年7月16日，河南省纪委网站通报了河南省三门峡市委书记赵海燕涉嫌严重违纪，接受组织调查的消息。2016年10月，中组部对一批违反换届工作纪律的典型案件进行通报，其中就包括赵海燕为他人职务调整接受说情打招呼的问题。<br><br>2017年8月31日，河南省纪委网站发布消息称，三门峡市灵宝市委书记李宏伟涉嫌严重违纪，目前正接受组织审查。<br><br>2018年4月14日，延津县法院一审判决被告人李宏伟犯受贿罪，判处有期徒刑十一年，并处罚金200万元；犯行贿罪，判处有期徒刑五年，并处罚金100万元；决定合并执行有期徒刑十三年，并处罚金300万元；涉案赃物予以没收，由扣押机关依法处理；非法所得及孳息共计1751余万元予以没收，由扣押机关上缴国库。</p>');
INSERT INTO `pastreview` VALUES ('104', '2019-05-15 18:28:00', null, '<h1>dasdad</h1>');
INSERT INTO `pastreview` VALUES ('105', '2019-05-16 16:14:56', null, '<p></p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;<iframe src=\"/vedio/he.mp4\"></iframe></p><p><br></p><p>每个人都会做梦呵呵，而且梦总是与“奇异”和“不可思议”联系在一起，有的梦让我们心旷神怡，有的梦却让我们担惊受怕。那么，我们为什么会做梦？在我们做梦时，大脑里究竟发生了什么？为什么我们常常记不住梦中情节？梦对我们意味着什么？梦能帮助我们学习吗？我们能做自己想做的梦吗……梦现象令普通人和梦研究者都为之入迷。为了解开梦的奥秘，科学家提出了许多理论。下面就让我们来看看科学家是如何解释奇异的梦现象的。<br><br>我们为什么会做梦？</p><p><img src=\"http://120.78.176.185:8056/rev/rev8237231318249824700.jpg\" style=\"max-width:100%;\"><br><br>几个世纪以来，人类一直试图弄清楚：为什么我们的大脑每天晚上都会进入稀奇古怪的梦世界？<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>对梦的较为严谨的科学研究始于17世纪。奥地利神经学家、精神分析的创始人弗洛伊德在《梦的解析》一书中，从心理学角度对梦进行了系统研究。他认为，梦是我们被压抑的渴望，我们不能够在社交场合公开表达的愿望，我们不能为人们接受的思想和欲望的潜意识活动。<br><br>早年曾与弗洛伊德合作的瑞士心理学家卡尔·荣格提出了不同的理论。他虽然认同梦有着心理学上的根源，但同时还认为，做梦让我们对清醒时的自己进行反思，我们在梦中思考和解决我们所遇到的一些问题。<br><br>20世纪60年代以后，对梦的研究进入生物学实验领域。1953年，美国芝加哥大学生物学研究生尤金·阿赛斯基发现，当人从浅睡转向深睡时，眼球会快速转动；而从深睡转向浅睡时，眼球会停止转动。眼球快速转动的深睡阶段被称为“快速眼动睡眠”（REM），眼球静止不动的浅睡阶段被称为“非快速眼动睡眠”（NREM）。如果将人们从快速眼动睡眠过程中唤醒，约80%的人会报告说他们正在做梦。<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>阿赛斯基的这一里程碑式的发现，迫使科学家们重新探究在睡眠过程中究竟发生了什么，20世纪60年代成为梦境研究的黄金时期。美国芝加哥大学研究人员威廉·德蒙特通过观察脑电图，发现健康成年人的睡眠会经历五个阶段，他还更加精确地定义了快速眼动睡眠阶段及其他睡眠阶段的特征。<br><br>1973年，美国哈佛医学院精神病医师艾伦·霍布森和他的同事罗伯特·麦卡莱通过在大脑脑干中植入微电极来识别产生电脉冲的个别神经细胞，提出了一种新理论，认为梦仅仅是大脑在睡眠中从记忆存储中随机抽取一些记忆片断产生的大脑电脉冲活动。对梦境的这一神经生理学研究成果令世界为之沸腾。<br><br>最近十几年中，随着X线断层摄影、功能性核磁共振成像等各种先进检测技术的应用，梦境研究得到了快速发展，科学家不仅能够看到大脑表面的情况，而且还能深入了解大脑深处的活动情况。科学家现在已经知道，当我们睡眠时大脑并没有完全休息。当一个人进入快速眼动睡眠时，其大脑的边缘区域会被激活（这一区域专门负责人的各种本能活动，包括睡眠与觉醒的调节，人的感官活动如视觉和嗅觉，以及人的各种情绪的形成等），而脑的额叶前部皮层——大脑的执行中心——则是关闭着的（这一部分负责更高级的大脑活动，包括对信息的推理、解释以及做出决策等）。由此，科学家破解了梦的更多秘密。<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>我们做梦时，大脑里到底发生了什么？<br><br>现在，科学家认为我们之所以会做梦与快速眼动睡眠有关（最新研究表明，梦也可以发生在非快速眼动睡眠中，但比较少见，而且没有快速眼动睡眠中那么强烈和清晰）。威廉·德蒙特将睡眠分为五个阶段。<br><br>当我们入睡后，即进入第一阶段的睡眠，此阶段的睡眠很浅，很容易被唤醒；第二阶段进入略深的睡眠；第三和第四阶段进入最深层次的睡眠。这四个阶段的睡眠属于非快速眼动睡眠（NREM）。随着大脑活动逐渐放缓，我们进入深度睡眠状态，此时除了δ波活动之外，我们的大脑什么感觉也没有。δ波是最慢的脑电波。<br><br>在我们进入睡眠大约90分钟后，也就是在第四睡眠阶段之后，我们进入第五阶段，即快速眼动睡眠（REM）阶段，其主要特征是眼睛的运动。在此阶段，我们的心跳和呼吸频率加快，血压升高，无法调节体温，我们的大脑活跃起来，甚至比清醒时更活跃，但我们身体的其他部位基本上都处于麻痹状态，直到我们退出REM状态。由于REM睡眠是梦最多的睡眠阶段，这种身体的暂时性瘫痪状态可以让我们以最自然的方式来确保我们不会将梦中行为付诸行动，要不然的话，如果睡在你边上的人梦见踢足球，那你就很可能会被他当作足球踢来踢去。<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>我们一晚上要经历多次这五个阶段的睡眠，但越往后，REM睡眠（第五阶段）越多，深度睡眠（第三和第四阶段）越少，到快天亮时，我们几乎只有第一、第二和第五阶段的睡眠。<br><br>那么，如果没有REM睡眠，会发生什么情况？早期研究认为，没有REM睡眠意味着没有梦，梦就像是大脑中的一个安全阀，帮助人们宣泄白天无法释放的情绪。有科学家在1960年做了一项研究：如果在受试者每次进入REM睡眠时都将其唤醒，会导致受试者出现轻微的心理障碍，如焦虑、易怒和注意力难以集中等。<br><br>进一步的研究试图将REM睡眠不足与记忆困难联系起来，但更多的研究反驳了这样的说法。一个无可辩驳的例子是：有个人因脑损伤导致没有REM睡眠，但他的记忆完全没有问题，他顺利完成了法学院的学业，日常生活也没有受到任何影响。<br><br>现在，研究人员正试图确定REM睡眠不足对于某些学习能力的影响。<br><br>为什么我们常常记不住梦中情节？<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>有研究说，在一个梦结束后5分钟回忆这个梦，我们会忘记50%的内容；10分钟后，我们已经忘记了90%的内容。为什么我们会很快忘记梦的内容，却不会如此快地忘记我们白天的日常行动？<br><br>弗洛伊德认为，我们之所以很容易就忘记了我们的梦，是因为梦包含了我们被压抑的想法和愿望，所以我们在潜意识里不希望记住它们。其他研究则认为，我们记不住梦的内容，原因很简单——其他的事情妨碍了我们记住梦。<br><br>与弗洛伊德同时代的一位梦研究者指出，有一些原因让我们不能清晰地记起我们的梦。例如，当我们刚睡醒时，会很快忘记许多东西，如身体的知觉，而许多梦境本身就是虚幻飘忽的，所以很容易被忘记。又如，我们之所以不记得梦，是因为我们没有刻意地去注意它们并进行记忆。通常，我们需要通过联想和重复才能完成记忆，但梦境通常是独一无二的，而且我们很少记得梦是怎样开始的，因而想要记住它们是困难的。就好比有人对你说了一个你以前不知道的词，你在短期内没有再使用它，于是很快就忘记它了。既然我们不能回到曾经的梦中去再次体验它，梦中细节自然就会从我们的记忆中很快消失。<br><br>科学家现在认为，人们之所以在醒来后往往记不住自己所做的梦，是因为在睡眠时，大脑中负责短期记忆的区域大部分都是不活动的，除非人在梦中突然醒来，一般来说，梦很快就会被遗忘。<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>梦能帮助我们学习吗？<br><br>一些科学家致力于探索梦与学习和记忆之间的重要联系。<br><br>以色列科学家艾琳·瓦姆莱斯通过研究发现，进入非快速眼动睡眠并梦见几小时前玩过的视频迷宫游戏的人，与进入非快速眼动睡眠但没有做梦的人相比，前者玩电脑游戏的水平在睡眠后大有提高。而一个人如果是在清醒的状态下回忆视频情景，他玩游戏的水平并不能提高多少。瓦姆斯莱指出，虽然她的研究主要集中于非REM睡眠阶段，但这种学习能力也发生在睡眠的各个阶段。<br><br>美国科学家马修·威尔逊认为，做梦是人的大脑在回顾白天的意识经验。他和他的同事通过使用精细电极，“窃听”实验鼠单个海马神经元（海马是与空间记忆相关的大脑区域）的活动。大脑海马区的单个神经元对某个具体空间位置会产生反应，每当老鼠通过迷宫中某个特定点的时候，老鼠大脑相应的单个神经元就会活跃起来。威尔逊等人由此成功地进入了实验鼠的梦境。他们发现，白天走过迷宫的实验鼠，在夜晚也会梦见迷宫。<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>相信梦能帮助我们学习的科学家指出，白天人们所经历过的一些事情存储于大脑的海马区，当入夜进入快速眼动睡眠阶段时，海马区神经组织异常活跃，大脑将这些记忆片断进行重演，然后再转存入大脑的永久记忆区域——大脑皮层。当海马区重放白天活动的片断时，大脑对其进行筛选，强化大脑细胞之间的联系，如此形成记忆，而新学得的东西也就得到了强化和巩固。<br><br>在未来，科学家也许能将睡眠和梦作为一种学习工具，就像我们白天意识清楚时的学习和教学一样。<br><br>我们能做自己想做的梦吗？<br><br>在2010年上映的科幻电影《盗梦空间》中，主角柯布成为一名能够潜入他人梦境中窃取秘密的盗贼，他甚至还能在别人的梦境中“种”下原本不存在的想法。科学家说，我们也许永远也无法达到《盗梦空间》里的水平，但我们可以让一个人的梦变得更快乐。<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>如何让一个人的梦变得更快乐？那就是做清醒梦。什么是清醒梦？就是在做梦时你知道自己在做梦，因而能够控制梦境向哪个方向发展。事实上，很多人都会做清醒梦。一项调查结果显示，当被问到“你是否做过知道自己是在做梦的梦”时，65%的人回答“是”。<br><br>心理学研究认为，清醒梦不仅可以让我们尽情享受梦的奇妙，而且有助于我们的身心健康，例如它可以增强我们的自信心、克服梦魇、改善精神状态，并有助于创造性地解决问题。对残疾人和其他弱势群体而言，清醒梦可以让他们的梦想变得触手可及，瘫痪病人可以在梦中再次行走，甚至还可以纵情舞蹈和飞翔。这种心理感知上的练习甚至还有助于中风患者的康复。<br><br>清醒梦还可以成为一种“世界模拟器”。就像飞行模拟器可以让人们在安全的环境下学习飞行一样，清醒梦可以让人们在任何可以想象的世界中生活，在各种可能性中体验，以更好地选择自己的未来。<br><br>那么，我们可以让自己做清醒梦吗？或者说，我们可以做自己想做的梦吗？<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>1989年，德国梦研究专家保罗·索利发表了一篇关于如何诱导人做清醒梦的论文。他在文中提出了诱导清醒梦的一种方法——“反射技巧”。这种诱导方法就是在你昏昏欲睡之时，经常训练自己问这样的一个问题：“我是在做梦吗？”<br><br>美国科学家斯蒂芬·拉伯奇等人提出了一个类似的控梦方法——“记忆诱导”。这种诱导方法具体来说就是：在晚上上床休息时，告诉自己要记住自己做的梦；然后，在做梦时集中思想予以识别，并记住那是一个梦；再后，集中思想重新进入之前的梦境，并在其中寻找能够表明确实在做梦的相关线索。你还可以想象，你想要那个梦如何继续下去，例如你想要飞，那你就想象自己在梦中自由飞翔。你可以重复最后的两个步骤（意识到自己在做梦，并重新进入梦境中），直到入睡。据说拉伯奇使用这样的方法，能按自己的意愿做各种快乐的清醒梦。<br><br>控梦方法又被称为“梦境孵化”，即在梦境诱导过程中埋下未来梦境的种子。那些相信通过做梦能解决问题的人，可以通过“梦境孵化”，运用梦诱导技巧，将自己的梦引导到一些具体问题上。例如，在睡觉前你可以反复提醒自己，你会梦见即将要进行的一次演讲，或梦见刚刚度过的一个愉快的假期。<br><br>为什么我们睡觉的时候大脑有时候会进入稀奇古怪的梦世界？<br><br>拥有控梦能力是一件非常美妙的事情。当然，这很难做到，你需要经过特殊的心理训练，才能掌握和运用这样的技能。<br><br>梦能给我们以预兆吗？<br><br>斯蒂芬·拉伯奇在其所著《清醒梦》一书中记述了下面这样一件事：一天，一个人带着小儿子到一座山谷中露营。他和儿子来到露营地附近的湖边，准备下水洗澡，却发现忘带肥皂了，于是他就让儿子站在湖边等他。他看到儿子捡起鹅卵石向水里扔着玩，便放心地走了。等他拿了肥皂回来时，发现儿子脸朝下地趴在水中，已经死了。这时，他猛然惊醒，知道自己刚才不过是做了一个可怕的梦。不久后，有朋友邀他和小儿子一起去露营。一天，他带儿子到湖边去洗澡，发现忘带肥皂了，他就让儿子坐在湖边等他，准备自己离开一会，去拿肥皂。可就在这时，他看到儿子伸手拿起石子向水里扔，曾经的梦境突然浮上心头。他一把拽起儿子，将他带离了湖边。<br><br>1998年曾有报道说，一个名叫斯托韦尔的人在一篇医学论文中提到，她曾采访了一些声称做过预知梦的人。在51例预知梦中，有37例最终都“梦想成真”。其中一例是，一个名叫伊丽莎白的女子梦见自己驾车行驶在一条公路上，至一座天桥下面时，远远看到一架飞机坠毁。而几周后，一架飞机真的就在她梦见的那条公路上坠毁了。<br><br>梦真的能预兆未来？抑或仅仅只是巧合？</p>');
