DROP TRIGGER IF EXISTS `t_make`;
DELIMITER ;;
CREATE TRIGGER `t_make` BEFORE INSERT ON `guestcomment` FOR EACH ROW BEGIN
DECLARE id VARCHAR(255);
DECLARE gid int(11);
DECLARE stuname VARCHAR(255);
DECLARE guname VARCHAR(50);
DECLARE gaddress VARCHAR(100);

set id = NEW.stuid;
set gid = NEW.guestid;
SELECT name from user where stuid = id into stuname;
SELECT GuestName from guest where GuestId = gid into guname;
SELECT Address from guest where GuestId = gid into gaddress;
set new.name = stuname;
set new.gname = CONCAT(guname," ",gaddress);
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `boardmessage`;
DELIMITER ;;
CREATE TRIGGER `boardmessage` AFTER UPDATE ON `guestcomment` FOR EACH ROW BEGIN
	DECLARE id int;
	DECLARE message varchar(255);
	set id = new.guestid;
	IF(new.isShow=1) THEN set message="审核已通过";
	ELSEIF(new.isShow=2) THEN set message="已被隐藏";
	ELSEIF(new.isShow=3) THEN set message="因不合规范已被删除";
	END IF;

END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `add`;
DELIMITER ;;
CREATE TRIGGER `add` AFTER INSERT ON `registrationrecord` FOR EACH ROW BEGIN
	DECLARE id int;
	DECLARE guestname varchar(255);
	DECLARE address varchar(255);
	set id = new.guestid;
	update guest set ordernum=ordernum+1 where GuestId = id;

END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `del`;
DELIMITER ;;
CREATE TRIGGER `del` AFTER UPDATE ON `registrationrecord` FOR EACH ROW BEGIN
	DECLARE id int;
	
	set id  = new.guestid;

	if(new.state=2) then
		update guest set ordernum=ordernum-1 where GuestId = id;
		
	end if;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `inrole`;
DELIMITER ;;
CREATE TRIGGER `inrole` AFTER INSERT ON `user` FOR EACH ROW BEGIN
	IF(new.type=1) THEN INSERT user_role(uid,roleid,addtime) values(new.stuid,3,NOW());
	ELSEIF(new.type=2) THEN INSERT user_role(uid,roleid,addtime) values(new.stuid,4,NOW());
	END IF;
END
;;
DELIMITER ;
DROP TRIGGER IF EXISTS `alertrole`;
DELIMITER ;;
CREATE TRIGGER `alertrole` AFTER UPDATE ON `user` FOR EACH ROW BEGIN
IF(new.type<>old.type) THEN
	BEGIN
		IF(new.type=1) THEN update user_role set roleid=3 where uid = new.stuid;
		ELSEIF(new.type=2) THEN update user_role set roleid=4 where uid = new.stuid;
		END IF;
	END;
END IF;
END
;;
DELIMITER ;
